import { View, Text, TextInput } from 'react-native'
import React from 'react'

const Searchbar = () => {
  return (
    <View style={{backgroundColor:"white",width:"60%",height:30,alignSelf:'center',marginTop:10}}>
      <TextInput style={{width:"100%",height:30,backgroundColor:"white",alignSelf:'center',padding:10,borderWidth:2}}
      placeholder="enter city">
      </TextInput>
    </View>
  )
}

export default Searchbar
